import Title from '../title';
import Light from '../title/light';

export default function Marcas() {
  return (
    <div className="bg-[#111827] grid grid-cols-2 px-20 py-24 sm:py-12">
      <div className="mx-auto max-w-7xl px-6 lg:px-8">
        <div>

        <Title title={'texto'} />
        <Light title={'texto'} />
        </div>
        <div className="mx-auto mt-10 grid max-w-lg grid-cols-2 items-center gap-x-8 gap-y-10 sm:max-w-xl sm:grid-cols-2 sm:gap-x-10 lg:mx-16 lg:max-w-none lg:grid-cols-2">
          <div className="bg-white rounded-3xl h-16   ">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/facebook-ads.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>
          <div className="bg-white rounded-3xl h-16   ">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/google-ads.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>

          <div className="bg-white rounded-3xl h-16   ">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/instagram.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>

          <div className="bg-white rounded-3xl h-16  ">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/linkedin.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>

          <div className="bg-white rounded-3xl h-16  ">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/face.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>

          <div className="bg-white rounded-3xl h-16  ">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/google.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>
          <div className="bg-white rounded-3xl h-16  ">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/google.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>
          <div className="bg-white rounded-3xl h-16  ">
            <img
              className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
              src={`${process.env.PUBLIC_URL}/../../../assets/google.png`}
              alt="Reform"
              width={158}
              height={48}
            />
          </div>
        </div>
      </div>
      <div className='w-[80%]  h-[80%]'>
        <img className='rounded-lg' src={`${process.env.PUBLIC_URL}/../../../assets/tablet.png`} alt="" />
      </div>
    </div>
  );
}
